import React from 'react';
import SmallCardPanel from './SmallCardPanel';
import NotePanel from './NotePanel';
import Navbar from './Navbar';
import './App.css';

function App (){
	return (
		<div>
			<Navbar />
			<div className="container">
				<div className="col-9">
					<SmallCardPanel />
				</div>
				<NotePanel />
			</div>
		</div>
	);
}

export default App;
